import classes from './ExamsContainer.module.css';

import OneExamShortView from './OneExamShortView';


const ExamsContainer=(props)=>{



  return (


   <div className={classes.parentContainer}>


   { props.examsData !==null && props.examsData.map((exam, index)=>{


          return <OneExamShortView key={index}  
	                           oneExam={exam}
	                           rerender={props.rerender}
		                   />

   }) 	  

   }	   


   </div>	

);




}

export default ExamsContainer;
